    .gallery {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
      gap: 16px;
      padding: 40px;
      max-width: 1600px;
      margin: auto;
    }

    .gallery a {
      display: block;
      border-radius: 12px;
      overflow: hidden;
      box-shadow: 0 8px 20px rgba(0, 0, 0, 0.4);
      transition: transform 0.3s ease;
      cursor: pointer;
      text-decoration: none;
    }

    .gallery a:hover {
      transform: scale(1.05);
    }

    .gallery img {
      width: 100%;
      height: auto;
      display: block;
      user-select: none;
      pointer-events: none;
    }
  </style>
